import React,{ Component} from 'react';

class List extends Component{
    constructor(props){
      super(props);
    }

    render(){
        return (
          <div className="List" style={{position: 'fixed', right: '30px'}}>
            {this.props.list.map((l)=> (
                <li>{l}<input type="checkbox"/></li>
            ))}
          </div>
        );
    }

}

export default List;
